use std::io;

fn main() {
    let input: u16 = read_input();
    even_or_odd(input);
}

fn read_input() -> u16 {
    println!("Type the number: ");

    let mut input = String::new();

    io::stdin()
        .read_line(&mut input)
        .expect("Failed to read line");

    let input: u16 = match input.trim().parse::<u16>() {
        Ok(num) => num,
        Err(_) => {
            println!("Please enter a valid number!");
            return read_input();
        }
    };
    input
}

